import React from "react";
import ReactDOM from "react-dom";
import cars from "../Practice";

const [honda, tesla] = cars;


const {model: carModel, colour: carColour, teslaSpeed: carSpeed} = tesla;

console.log(carColour[0]);

function Destracting() {
    return (
        <div>
            <table>
                <tr>
                <th>Brand</th>
                <th>Top Speed</th>
                </tr>
                <tr>
                    <td>{tesla.model}</td>
                    <td>{tesla.teslaSpeed}</td>
                    <td>{tesla.colour}</td>
                </tr>
                <tr>
                <td></td>
                <td></td>
                </tr>
            </table>,
        </div>
      
    )
}
export default Destracting;
